import React from 'react';

function CopyRight()
{
  return(
    <div>
    <section className="copyright">
      <center>
        <h2> &copy; 2k24 <i>Web App</i> <br/>
                    Designed by <b>Sai Madhav</b> <br/> 
                    <i>EdTech: B.E, M.Sc,. with 2+ IT Industry </i> 
        </h2>
      </center>
    </section>
    </div>
  );
}

export default CopyRight;
